def send_groupMessage(page_send_group: Union[ChromiumPage, ChromiumTab], user_id_send_group, user_list):
    ac = Actions(page_send_group)
    to_send_box = page_send_group.ele('tag:a@href=/direct/inbox/', timeout=10)
    to_send_box.click()
    logger.info(f'{user_id_send_group}点击消息按钮')

    new_message_box = page_send_group.ele('tag:svg@aria-label=新消息', timeout=10)
    new_message_box.click()
    page_send_group.wait(2, 3)
    logger.info(f'{user_id_send_group}创建新消息')

    main_box = page_send_group.ele('tag:div@role=dialog', timeout=10)
    send_input_box = page_send_group.ele('tag:input@name=queryBox', timeout=5)
    page_send_group.wait(1, 2)
    logger.info(f'{user_id_send_group}准备开始拉群流程')

    count = 1
    for user_name in user_list:
        send_input_box.input(user_name)
        page_send_group.wait(2, 3.5)
        s_main_box = main_box.s_ele()
        s_nameBox_list = s_main_box.eles('tag:div@tabindex=0')[1:]
        user_count = 2
        for s_name_box in s_nameBox_list:
            s_obj_box = s_name_box.ele(f'tag:span@@text()={user_name}')
            if s_obj_box:
                break
            user_count += 1
        obj_box = main_box.ele('tag:div@tabindex=0', index=user_count, timeout=10)
        if not obj_box.states.is_displayed:
            ac.move_to(obj_box).scroll(on_ele=obj_box)
        obj_box.click()
        logger.debug(f'{user_id_send_group}已完成第{count}个用户的添加')
        count += 1
    create_send_box = main_box.ele('tag:div@tabindex=0', index=-1, timeout=3)
    create_send_box.click()

    page_send_group.wait(2, 3)
    message_box = page_send_group.ele('tag:div@aria-label=发消息', timeout=20)
    if not message_box:
        logger.warning(f'{user_id_send_group}当前帐号出现问题，暂时停止')
        return False
    message_box.input('hello')
    page_send_group.wait(1, 1.5)

    send_box = page_send_group.ele('tag:div@@text()=发送')
    send_box.click()
    logger.success(f'{user_id_send_group}消息发送成功')

    return True


