def collect_user_data(page_collect_user: Union[ChromiumPage, ChromiumTab], user_id_collect_user: str,
                      user_keyword1: str):
    logger.info(f'{user_id_collect_user}开始执行关键词搜索')
    page_collect_user.ele('tag:a@href=#', index=1, timeout=10).click()

    input_box = page_collect_user.ele('tag:input@type=text', timeout=10)
    input_box.input(user_keyword1)
    logger.debug(f'{user_id_collect_user}当前关键词{user_keyword1}')
    page_collect_user.wait(4, 5)

    logger.info(f'{user_id_collect_user}准备点击非个性化按钮')
    next_data = page_collect_user.ele('@aria-label=非个性化', timeout=10)
    next_data.click()
    ac = Actions(page_collect_user)
    ac.move_to(next_data).click()
    page_collect_user.wait(2, 3)
    return True


def listen_user_data(page_listen_user: Union[ChromiumPage, ChromiumTab], user_id_listen_user, user_keyword):
    """监听用户数据_获取用户名"""
    page_listen_user.listen.start('/api/graphql')  # 开始监听，指定获取包含该文本的数据包
    logger.info(f'{user_id_listen_user}监听开始')
    count = 0

    for packet in page_listen_user.listen.steps(timeout=30):
        try:
            has_aaa_key = any('fbsearch' in key for key in packet.response.body['data'].keys())
        except (KeyError, TypeError):
            has_aaa_key = False
        if has_aaa_key:
            try:
                my_utils.save_ins_user(packet.response.body['data']['xdt_api__v1__fbsearch__topsearch_connection'],
                                       user_id_listen_user, user_keyword)
            except KeyError:
                try:
                    my_utils.save_ins_user(packet.response.body['data']['xdt_api__v1__fbsearch__non_profiled_serp'],
                                           user_id_listen_user, user_keyword)
                except KeyError:
                    continue
            logger.success(f'{user_id_listen_user}监听到第{count + 1}个数据包')
            print(packet.response.body['data'])
            count += 1
        if count == 2:
            break
    return True


def listen_user_fans(page_listen_fans: Union[ChromiumPage, ChromiumTab], user_id_listen_fans, userName_fans,
                     stop_event_ls: threading.Event):
    """监听用户粉丝_获取用户名"""
    page_listen_fans.listen.start('bulk-route-definitions')  # 开始监听，指定获取包含该文本的数据包
    logger.info(f'{user_id_listen_fans}监听开始')
    count = 0

    for packet in page_listen_fans.listen.steps(timeout=60):
        my_utils.save_ins_fans(packet.response.body[9:], user_id_listen_fans, userName_fans)
        logger.success(f'{user_id_listen_fans}监听到第{count + 1}个数据包')
        count += 1
    stop_event_ls.set()

    return True


def collect_user_fans(page_col_fans: Union[ChromiumPage, ChromiumTab], user_id_col_fans, userName_fans_col,
                      stop_event: threading.Event):
    page_col_fans.get(f'https://www.instagram.com/{userName_fans_col}/followers/')
    logger.debug(f'{user_id_col_fans}进入{userName_fans_col}粉丝页面')
    page_col_fans.wait(3, 5)

    ac = Actions(page_col_fans)
    main_box = page_col_fans.ele('tag:div@role=dialog', timeout=10)
    button_box = main_box.ele('tag:button', index=3, timeout=10)
    ac.move_to(button_box).scroll(0, 1000)

    while not stop_event.is_set():
        ac.scroll(0, 1000)
        page_col_fans.wait(1, 1.5)

    return True


